How it’s changed, itself!

@gtdguy @rydercarroll @J_CameronLive Now, I don't follow any of these systems exactly, because everything needs to be customized to your own needs.

But these were the best foundations for me to start from.

Have you tried any of them?

@gtdguy @rydercarroll @J_CameronLive But GTD gets it.

GTD says, "yes, you have a lot going on in your head, let's get it out of there, and come up with a place to put it and way to figure out what to do with it."

Just the capture habit idea alone changed my life as an ADHD &amp; autistic person.

most productivity content is written for productivity nerds.

people who aren't actually struggling with getting things done, they just want to do more anyway.

@workbrighterco is actual productivity help, not just productivity porn.

