@stephsmithio Do I agree it works for him? Sure.

But it's okay to have an experience and say "this is how it works for me" vs "this is how it must work for everyone."

I know for sure that's not how neurodivergent brains work.

@mattlady To start, unlearn the idea that money is all that's needed to make a difference. 😀 

That's still thinking within the capitalist &amp; consumerist framework, it's still playing that game.

Money is different from wealth, and both are different from impact/making a difference.
